VALUES ('4009175922618', 'tablettes lave-vaisselle', 'Xygeles, 3% dgeits de surface non ioniques, polycarbOxylates, enzymes (amylase, protease), parfums. Contient aussi: bicarbonate. INDICATIONS: Ne pas laver en lave-vaisselle: articles en bois, vaisselle ayant un décor doré ou argenté, aluminium, cristal et porcelaine peinte à la main. Les tablettes Tout en 1 Rainett doivent être utilisées en lave-vaisselle uniquement. Les tablettes Tout en 1 Rainett ne protègent pas les verres contre les dommages causés mécaniquement. Recommandé pour tous les types de lave-vaisselle. Conserver le produit dans un endroit frais et sec, dans son emballage d\'origine. Il est recommandé de refermer l\'emballage après usage. . Pour plus d\'informations sur le dosage, contacter notre service consommateur. SERVICE CONSOMMATEUR RAINETT: Tel.: 05 55 89 29 20 E-mail: contact@werner-mertz.fr Made in EU INTEGRALEMENT DURABLE.FR Distribué par Werner & Mertz GmbH France SASU Ilis', 'https://static.openfoodfacts.org/images/products/400/917/592/2618/front_fr.5.400.jpg', '', '', '', '', '', '', '', '', '', '1');

